import { motion } from "framer-motion"
function Projects (){
    const [count, setCount] = useState(0);
    return (
        <motion.div
        drag
        dragConstraints={{
          top: -50,
          left: -50,
          right: 50,
          bottom: 50,
        }}
      />
);
}
export default Projects;
